import React from 'react'
import Card from './Card'


function Home( { sayingObj } ) {
    const randomNumber=Math.floor(Math.random() * sayingObj.length)
    const randomObj= sayingObj.find(card => card.id===randomNumber)
    let randomCard = <Card key={randomCard.id} jargon={randomCard.jargon} definition={randomCard.definition} sentence={randomCard.sentence} image={randomCard.image} id={randomCard.id}/>
    return (
        <div>
            <h1>Welcome to the home of corporate jargon</h1>
            <div className='randomCard' >
            {randomObj === undefined ? <p>Loading...</p> : randomCard}
            </div>
        </div>
    )
}

export default Home
